import {useRef} from 'react';
import './App.css';
import Canvas from './canvas/Canvas';
import Output from './output/Output';


function App() {
	const canvasRef = useRef<HTMLCanvasElement>(null);
	const eyeLRef = useRef<number>(0);
	const eyeRRef = useRef<number>(0);
	const mouthRef = useRef<number>(0);
	const noseRef = useRef<number>(0);
	const otherRef = useRef<number>(0);
	return (
		<body className="h-screen bg-gradient-to-r from-yellow-400 via-red-500 to-pink-500">
			<Canvas canvasRef={canvasRef} eyeLRef={eyeLRef} eyeRRef={eyeLRef} noseRef={eyeLRef} mouthRef={eyeLRef} otherRef={otherRef}/>
			<Output canvasRef={canvasRef} eyeLRef={eyeLRef} eyeRRef={eyeLRef} noseRef={eyeLRef} mouthRef={eyeLRef} otherRef={otherRef}/>
		</body>
	);
}

export default App;
